<?php

use CidiLabs\PhpAbbyy\PhpAbbyy;
use PHPUnit\Framework\TestCase;

class PhpAbbyyTest extends TestCase {

    protected $options;
    protected $jobId = "{049BB326-33FD-4AAC-BE20-CAEE6DF5EE1D}";

    public function testInit() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->getMock();

        $this->assertEquals(true, is_object($abbyy));
    }

    public function testConversion() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->onlyMethods(['isReady','convertFile','getFileUrl','deleteFile'])
            ->getMock();

        $jobId = $abbyy->convertFile($this->getTestOptions());

        print "JOB ID: {$jobId}";
        exit;

        $this->assertEquals(true, !is_null($jobId));

        $abbyy->expects($this->any())
            ->method('isReady')
            ->willReturn(true);

        $convertedUrl = $abbyy->getFileUrl($jobId);

        $this->assertEquals(true, $abbyy->deleteFile($convertedUrl));
    }

    public function testIsReadyTrue() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->onlyMethods(['isReady','getPostOptions','getFileUrl','deleteFile'])
            ->getMock();

        $abbyy->expects($this->any())
            ->method('getPostOptions')
            ->willReturn($this->getTestOptions());
            
        $jobId = $abbyy->convertFile($this->getTestOptions());


        $abbyy->expects($this->any())
            ->method('isReady')
            ->willReturn(true);

        $this->assertEquals(true, $abbyy->isReady($jobId));

        $convertedUrl = $abbyy->getFileUrl($jobId);
        $this->assertEquals(true, $abbyy->deleteFile($convertedUrl));
    }

    public function testIsReadyFalse() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->getMock();

        $taskId = 'fakeJobId';

        $this->assertEquals(false, $abbyy->isReady($taskId));
    }

    public function testGetFileUrlFalse() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->getMock();

        $taskId = 'fakeJobId';

        $this->assertEquals(true, is_null($abbyy->getFileUrl($taskId)));
    }

    public function testDeleteFileFalse() {
        $abbyy = $this->getMockBuilder(PhpAbbyy::class)
            ->getMock();

        $fileUrl = 'fakeFileUrl';

        $this->assertEquals(false, $abbyy->deleteFile($fileUrl));
    }

    private function getTestOptions()
    {
        return [
        'json' => [
            'FileName' => "test.pdf",
            'FileContents' => "",
        ]
        ];
    }
}